import React, { Component } from 'react';
import axios from 'axios';


export default class AfficheProfil extends Component {

  constructor(props) {
    super(props);
    this.state = { profil: [] };

  }
  componentDidMount() {
    axios.get('http://localhost:8080' + this.props.location.pathname)
      .then(response => {
        console.log('i am a response', response)
        this.setState({ profil: response.data });
        console.log('i am a response', response.data.email)
        // this.setState({ profil: response.data });
        // this.setState({ profil: response.data });
        // this.setState({ profil: response.data });
      })
      .catch(function (error) {
        console.log(error);
      })
  }

  liste() {
    return (this.state.profil.length > 0) ? (this.state.profil.map((obj) => {
      return(
          <div className="table-responsive">
            <table className="table">
              <thead>
                <tr>
                  <h2>profil</h2>
                </tr>
                <tr>
                  <th>ID</th>
                  <th>NOM</th>
                  <th>EMAIL</th>
                  <th>PASSWORD</th>
                  <th>PHOTO</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>{obj._id}</td>
                  <td>{obj.nom}</td>
                  <td>{obj.email}</td>
                  <td>{obj.password}</td>
                  <td><img  alt="pdp" width="50px" height="50px" src={'http://localhost:8080/user/'+obj.photo_profil}/></td>
                </tr>
              </tbody>
            </table>
          </div>
      )

    })) : ''
  }
  render() {
    return (
      <div>
        {this.liste()}
      </div>
    );
  }
}
